import React from 'react';


function Login() {
  return (

 <div className="container">
     <div className="heder">
         <h1> login </h1>
     </div>

     <div className="main">
        <form>
            <span>
            <input type="text" placeholder="user name" name=""/>
            </span>
            <br/>
            <span>
            <input type="password" placeholder="password" name=""/>
            </span><br/>
            <button>login</button>
        </form>
     </div>




 </div>
  );
}

export default Login;
